import React, { useState, useEffect } from "react";
import { AllStars } from "./types/types";

const getStars = () => {
  let allStars: AllStars;

  fetch("http://localhost:777/getStars", {
    method: "GET",
    headers: {
      "Content-Type": "application/json",
    },
  })
    .then((response) => response.json())
    .then((data: AllStars) => (allStars = data));
};

function App() {
  useEffect(() => {});

